import React from 'react';
import './App.css';

const App = () =>{
  return (
    <div className="App">
      <ul>
        <li>CSS</li>
        <li>HTMl</li>
        <li>JS</li>
        <li>React</li>
      </ul>
    </div>
  );
}

export default App;
